import * as actionTypes from "./user-types";



export const userLogin = (userData) => {
  return {
    type: actionTypes.USER_LOGIN,
    payload: {
      data: userData,
    },
  };
};

export const userLogout = () => {
  return {
    type: actionTypes.USER_LOGOUT
  };
};
